contracts/DataStorage.sol.content:
pragma solidity ^0.8.9;

contract DataStorage {
  Data[] public dataSet;

  struct Data{
    uint sensorId;
    string timeStamp;
    uint value;
  }

  function addData(uint Id, string memory time, uint sensorvalue) public {
    dataSet.push(Data(Id, time, sensorvalue));
  }

  function getData(uint arrayPointer) view public returns (uint Id, string memory time, uint sensorvalue) {
    Id = dataSet[arrayPointer].sensorId;
    time = dataSet[arrayPointer].timeStamp;
    sensorvalue = dataSet[arrayPointer].value;
  }

  function getAllDataBySensor(uint givenId) view public returns (Data[] memory returnData){
    uint x = 0;
    for (uint i = 0; i < dataSet.length; i++){
      if (dataSet[i].sensorId == givenId){
        returnData[x] = dataSet[i];
        x++;
      }
    }
  }
}

